[ad] Friends, I'm so excited to share the news with you that @deebeesorganics is offically in Costco Nationwide! @deebeesorganics is a woman owned (@deebeesfounder), Canadian based company who's mission is to support all kids to confidently step into the best versions of themselves. We don't just love eating these freezies, but we also truly love supporting their mission. 

As of this month, you can find their 35-pack of Classic Super Fruit Freezies at any Costco! These freezies are made with plant based, gluten free ingredients, are certified organic and free of any artificial flavors, colors or preservatives! Because of this, I felt no guilt letting Wilder have multiple a day while they were teething. Did I mention these for us through teething?! If you've got a teething kiddo, I'm telling you, these are a jackpot! But they are also super yummy! 

I don't typically like trips to Costco, but finding @deebeesorganics there sure was fun! If you try them out, let me know what flavor is your favorite below! Can you guess Wilder's favorite flavor? :)

